import React from 'react'
import { useNavigation } from 'react-router-dom';

export default function AddPeople() {
const navigate = useNavigation()

  return (
    <>
    <div className={classes.nav}>
      <nav>
        <ul>
            <li onClick={() => {
              navigate('/addPeople');
            }}>Dashboard</li>
            <li>People</li>
            <li>Add People</li>
        </ul>
      </nav>
    </div>

</> 
 )
}
